const SubStr= require('./substring');

function Collt(st1,datas){
var result;
result=datas.filter((data)=>{
    var t=0;
    if(SubStr(st1,data.name)){t+=1;}
    
    return t>0;
})


return result;
}
module.exports.Collt = Collt;
